import './SwiperExample.css';

import { Navigation, Pagination, Scrollbar, A11y } from 'swiper/modules';

import { Swiper, SwiperSlide } from 'swiper/react';

import Image1 from '../Swiper/Image/image1.webp';
import Image2 from '../Swiper/Image/image2.webp';
import Image3 from '../Swiper/Image/image3.webp';

import 'swiper/css';
import 'swiper/css/navigation';
import 'swiper/css/pagination';
import 'swiper/css/scrollbar';

import { Container } from 'react-bootstrap';

function SwiperExample(){
    return(
        <Container fluid>
            <Swiper
            modules={[Navigation, Pagination, Scrollbar, A11y]}
            spaceBetween={10}
            slidesPerView={3}
            navigation
            pagination={{ clickable: true }}
            onSwiper={(swiper) => console.log(swiper)}
            onSlideChange={() => console.log('slide change')}>
                
                <SwiperSlide>
                    <img src = {Image1} className = "w-100"/>
                </SwiperSlide>

                <SwiperSlide>
                    <img src = {Image2} className = "w-100"/>
                </SwiperSlide>

                <SwiperSlide>
                    <img src = {Image3} className = "w-100"/>
                </SwiperSlide>

                <SwiperSlide>
                    <img src = {Image1} className = "w-100"/>
                </SwiperSlide>

                <SwiperSlide>
                    <img src = {Image2} className = "w-100"/>
                </SwiperSlide>

                <SwiperSlide>
                    <img src = {Image3} className = "w-100"/>
                </SwiperSlide>
            </Swiper>
        </Container>
    )
}

export default SwiperExample
